INSERT INTO `overallnews` (`id`, `data_date`, `news_id`, `place_id`, `place`, `news`) VALUES
(1, '2014-01-31', 'cnews', 'cplace', 'SADASHIV NAGAR', 'A PRINCIPAL OF KENDRIYA VIDYALAYA SCHOOL HAS BEEN ARRESTED UNDER THE POCSO ACT FOR ALLEGEDLY SEXUALLY ABUSING AND HARASSING GIRL STUDENTS AND WOMEN STAFF OF KENDRIYA VIDAYALA SCHOOL SITUATED AT SADASHIV NAGAR.'),
(2, '2016-07-19', 'cnews', 'cplace', 'KHAMMAM AND NIZAMABAD', 'THERE ARE ONLY THREE UNITS IN KARIMNAGAR, WARANGAL, AND THE WOMEN PROTECTION CELL IN HYDERABAD. HOWEVER, EXPERTS HAVE FOUND KHAMMAM AND NIZAMABAD TO BE THE MOST VULNERABLE DISTRICTS FOR HUMAN-TRAFFICKING, WHERE THERE ARE NO AHTUS. \r\n'),
(3, '2015-07-09', 'cnews', 'cplace', 'ASSAM', 'THREE AFFILIATES OF THE RASHTRIYA SWAYAMSEVAK SANGH (RSS) WERE INVOLVED IN TRAFFICKING OF 31 TRIBAL GIRLS FROM ASSAM UNDER THE GARB OF BETTER EDUCATION, AND SAID THAT THEY WOULD ALSO RAISE THE ISSUE IN PARLIAMENT.'),
(4, '2012-06-09', 'cnews', 'cplace', 'GOA', 'ABOUT 32 BOOTLEGGERS HAVE BEEN ARRESTED,BOOTLEGGING NUISANCE DUE TO PROXIMITY OF GOA STATE IN THE KONKAN SECTION AND IN 2016, DUE TO REGULAR AND CONSISTENT DRIVES AND WITH THE EFFECTIVE USE OF CCTV AND VIDEO SURVEILLANCE AT STATIONS BY RPF STAFF.'),
(5, '2016-05-22', 'pnews', '', '', '''''DIGITAL INDIA'''' BECOMES THE THEME OF MIT CONFERENCE 2017-WE WILL EXPLORE INNOVATIVE IDEAS AND PRACTICAL SOLUTIONS ADOPTED BY DIFFERENT ENTITIES - GOVERNMENT, BIG CORPORATIONS AND EMERGING START-UPS - TO EMPOWER THE COUNTRY WITH INCREASED ACCESS TO DIGIT'),
(6, '2010-01-25', 'cnews', 'cplace', 'BEHALA', '19 OF THE 20 PERSONS ARRESTED IN CONNECTION WITH BABY TRAFFICKING CASE. DR NITYANANDA BISWAS, WAS ARRESTED FROM BEHALA. HE WAS ASSOCIATED WITH THE MOHANANANDA BRAHMACHARI SHISHU SEVA KENDRA.'),
(7, '2016-08-11', 'pnews', '', '', '192 MLAS IN 5 NEW ASSEMBLIES HAVE CRIMINAL CASES: REPORT- 193 (28 PER CENT) MLAS HAVE DECLARED THEIR EDUCATION QUALIFICATION TO BE BETWEEN 5TH PASS AND 12TH PASS, WHILE 473 (69 PER CENT) MLAS HAVE DECLARED HAVING A QUALIFICATION OF GRADUATE OR ABOVE.'),
(8, '2016-07-08', 'pnews', 'pplace', 'KASHMIR', '88 YOUTH JOIN MILITANCY IN KASHMIR IN 2016: GOVT-"IN 2016 MAXIMUM NUMBER OF YOUTH JOINED MILITANT RANKS SINCE 2010," GOVERNMENT SAID, ADDING, "66 IN 2015, 53 IN 2014, 16 IN 2013 AND 21 IN 2012 HAVE JOINED OUTFITS.'),
(9, '2013-10-11', 'cnews', '', '', 'A 12 YR OLD CHILD WAS ASSAULTED BY A RETIRED TEACHER AFTER THE CASE WAS REGISTERED BY THE POLICE IN 2006. THE PROSECUTION CASE WAS THAT THE ACCUSED BARGED INTO THE RESIDENCE OF THE COMPLAINANT AND THRASHED HIM USING A PALM FROND.'),
(10, '2015-11-08', 'cnews', '', '', 'A 19 YR OLD WOMAN WAS TRAFFICKED AND RAPED IN DELHI. FROM THE POLICE AND NGO SOURCESRISHI RAJ BROUGHT HER AT HIS BROTHER''''S HOUSE RAJU AT BHAGWAN DAS ROAD, DELHI.RISHI FEARED THAT POLICE WI8LL REACH HIM AND HENCE SHIFTED HER TO HIS FRIEND''''S ROOM IN SARAI'),
(11, '2011-05-10', 'cnews', '', '', 'A 4 YR OLD GIRL WAS SEXUALLY ASSAULTED BY A SINGER. NEIGHBOURS GATHERED AT THE SPOT WHEN THE GIRL RAISED AN ALARM.THE ACCUSED TUPAKULA VENKATA RATNAM, A SINGER WAS TAKEN INTO CUSTODY BY THE COPS.'),
(12, '2015-06-17', 'cnews', 'cplace', 'PANVEL', 'A 40-YEAR-OLD GARAGE OWNER FROM PANVEL HAS BEEN ARRESTED BY THE CITY POLICE FOR SEXUALLY ASSAULTING A 14-YEAR-OLD GIRL. THE LATTER IS THE DAUGHTER OF HIS FRIEND WHO WORKS IN DUBAI.THE GIRL''''S MOTHER HAS LODGED A COMPLAINT ON JANUARY 19.'),
(13, '2015-01-06', 'cnews', '', '', 'A 49-YEAR-OLD VASHI SCHOOLTEACHER WAS ARRESTED AFTER THE MOTHER OF A CLASS V STUDENT FILED A POLICE COMPLAINT ALLEGING THAT HE HAD TOUCHED HER 11-YEAR-OLD DAUGHTER INAPPROPRIATELY DURING SCHOOL HOURS.'),
(14, '2015-01-21', 'cnews', 'cplace', 'SHAHPUR', 'A CHILDLESS COUPLE FROM SHAHPUR WAS SEEN WITH A 10-DAY-OLD CHILD,THE COUPLE SAID THEY HAD ADOPTED THE CHILD FROM A HOSPITAL IN DEESA.'),
(16, '2016-09-18', 'cnews', 'cplace', 'PUNE', 'A MAN WHO HAD LOST HIS JOB AS A SECURITY GUARD IN PUNE AND RETURNED TO THE CITY KILLED HIS WIFE AND SON BEFORE JUMPING BEFORE A MOVING TRAIN LATE ON FRIDAY NIGHT. THE SUICIDE NOTE RECOVERED FROM THE SCENE OF THE CRIME'),
(17, '2014-06-12', 'cnews', 'cplace', 'SANTOSHNAGAR POLICE', 'A TEAM OF OPERATION SMILE ALONG WITH THE SANTOSHNAGAR POLICE ON WEDNESDAY RAIDED A RESIDENCE AT JYOTHY BAGH IN SANTOSHNAGAR WHERE AN ILLEGAL BANGLE FACTORY WAS RUNNING. DURING THE RAID, POLICE RESCUED TWO MINOR CHILDREN HAILING FROM BIHAR.'),
(18, '2012-09-06', 'cnews', 'cplace', 'KADWA VILLAGE', 'A TEAM OF POLICE LED BY BARHI SDO SHABIR AHMAD RECOVERED A 10-YEAR-OLD BOY ALIVE FROM A MUD-FILLED PIT ALONGSIDE THE STRETCH OF NATIONAL HIGHWAY-33 AT KADWA VILLAGE IN THE DISTRICT.'),
(19, '2010-02-12', 'cnews', 'cplace', 'KENDRAPADA', ' GITA MURMU SOLD HER INFANT ON MONDAY TO HER NEIGHBOUR, MAMATA SAHOO, FOR RS 2,000,THEY WERE PROVIDED SHELTER IN A GOVERNMENT-RUN SHORT-STAY HOME IN KENDRAPADA.'),
(20, '2014-05-27', 'cnews', 'cplace', 'MOTA KOPRA VILLAGE', 'ACCORDING TO POLICE, DARZI OF MOTA KOPRA VILLAGE NEAR BHILDI IN DEESA TALUKA OF BANASKANTHA HAD SOLD A BABY BOY (THEN FIVE-DAYS-OLD) TO A COUPLE FROM AHMEDABAD FOR RS 80,000 AFTER BUYING THE CHILD FROM MALI, A DRIVER, FOR RS 20,000 LAST WEEK.'),
(21, '2017-01-23', 'pnews', 'pplace', 'UP', 'ACT ON A WAR FOOTING, MAKE 30 DISTRICTS OPEN DEFECATION FREE BY DECEMBER-THE CHIEF MINISTER SAID THAT, "UP LAGS BEHIND OTHER STATES AS FAR AS CLEANLINESS IS CONCERNED. DESPITE AVAILABILITY OF SAFAI WORKERS BOTH IN URBAN AND RURAL AREAS.'),
(22, '2016-10-02', 'tnews', '', '', 'ADOBE, MICROSOFT TEAM UP TO TAKE ON ORACLE, SALESFORCE-MICROSOFT AND ADOBE SYSTEMS ARE JOINING TO MAKE THEIR RESPECTIVE SALES AND MARKETING SOFTWARE PRODUCTS MORE POTENT COMPETITORS TO SALESFORCE.COM AND ORACLE OFFERINGS.'),
(23, '2016-08-20', 'pnews', '', '', 'AIR INDIA MAY OFFER FREE WI-FI ON DOMESTIC FLIGHTS-AIR INDIA IS PLANNING TO HAVE WI-FI ON BOARD ITS AIRBUS A-320 PLANES, ONCE MATERIALISED, AI WILL BE THE FIRST AIRLINE TO OFFER FREE WI-FI.'),
(24, '2017-02-10', 'pnews', '', '', 'AKHILESH YADAV BANKS ON LUCKY MERCEDES ''''RATH''''-THE RATH MAY CONJURE UP IMAGES OF MYTHICAL HEROES ASTRIDE HORSE-DRAWN CHARIOTS, BUT THE VEHICLE ON WHICH AKHILESH HAS SET OUT ON HIS POLL CONQUEST IS ACTUALLY A MODIFIED MERCEDES BENZ BUS.'),
(25, '2016-12-12', 'tnews', '', '', 'APPLE 9.7-INCH IPAD, IPHONE 7, 7 PLUS RED COLOUR EDITION: INDIA PRICE AND AVAILABILITY-APPLE ALSO LAUNCHED A NEW VIDEO-MAKING APP CALLED CLIPS AND EXTENDED LANGUAGE SUPPORT FOR SWIFT PLAYGROUNDS.'),
(26, '2017-02-24', 'pnews', 'pplace', 'UTTAR PRADESH', 'WHY NARENDRA MODI AND AMIT SHAH PICKED YOGI ADITYANATH AS UTTAR PRADESH CM-MODI AND SHAH ALWAYS CONSIDERED YOGI ADITYANATH A STRONG CANDIDATE.\\R\\NSURVEYS SHOWED POPULARITY, CAMPAIGNING SHOWED DISCIPLINE AND APPEAL ACROSS STATES.'),
(27, '2017-02-21', 'tnews', '', '', 'APPLE LAUNCHES CLIPS VIDEO-MAKING APP, EXTENDS LANGUAGE SUPPORT FOR SWIFT PLAYGROUNDS-APPLE LAUNCHED THE 2017 VERSION OF ITS 9.7-INCH IPAD TABLET, ALONG WITH PRODUCT RED SPECIAL EDITIONS OF THE IPHONE 7 AND IPHONE 7 PLUS SMARTPHONES.'),
(28, '2016-12-22', 'tnews', '', '', 'APPLE WATCH GETS BANDS IN NEW COLOURS, IPHONE 7 AND 7 PLUS NEW CASES-HE NEWLY-LAUNCHED BANDS ARE AVAILABLE IN A NUMBER OF FRESH AND BRIGHT COLOURS, ALLOWING USERS TO PERSONALIZE THEIR APPLE WATCHES EVEN MORE.'),
(29, '2012-03-13', 'cnews', '', '', 'ARVIND KUMAR(40), HIS WIFE KAMLESH(38) AND HIS SON-IN-LAW YOGESH KUMAR(25) WAS INVOLVED IN THIS RACKET.TWO MEN PAID RS 5 LAKHS AND RS 3.5 LAKHS FOR TWO GIRLS AND THE YOUNGEST GIRL WAS WITH YOGESH TILL A SUITABLOE MATCH WAS FOUND.'),
(30, '2013-09-25', 'cnews', 'cplace', 'AZAD NAGAR', 'AZAD NAGAR POLICE STATION, TWO TEAMS, INVOLVING OFFICIALS FROM DEPARTMENTS LIKE LABOUR, POLICE, EDUCATION, REVENUE, AND WOMEN AND CHILD WELFARE, ALONG WITH NGOS WERE INVOLVED DEPUTY COMMISSIONER D S RAMESH RESCUED FOUR CHILD LABOURERS.'),
(31, '2016-04-23', 'tnews', '', '', 'BARRACUDA ANNOUNCES CLOUD-READY NEXT GENERATION FIREWALL-THE NEW VERSION PROVIDES CLOUD-BASED CENTRAL MANAGEMENT SUPPORT IN MICROSOFT AZURE FOR AN UNLIMITED NUMBER OF MANAGED FIREWALLS.'),
(32, '2016-03-18', 'pnews', 'pplace', 'BIHAR', 'BIHAR MINISTERS, MLAS FAVOUR AWAY WITH BEACON LIGHTS-ON MARCH 18 IN ITS FIRST CABINET MEETING THE AMARINDER SINGH GOVERNMENT HAD DECIDED TO PUT A BAN ON THE USE OF BEACON LIGHTS ON VEHICLES OF MINISTERS, MLAS & BUREAUCRATS TO END VIP CULTURE IN PUNJAB.'),
(33, '2014-07-28', 'pnews', 'pplace', 'KERALA', 'BJP, RSS ARE NOT UNDEFEATABLE: KERALA CM PINARAYI VIJAYAN-THE CPI-M POLITBURO MEMBER SAID THE BJP WON BY SPREADING COMMUNAL HATRED, THROUGH HEAVY INJECTION OF MONEY AND DEPLOYING ENTIRE CENTRAL GOVERNMENT MACHINERY IN THE STATE.'),
(34, '2016-01-15', 'pnews', '', '', 'BJP’S LANDSLIDE WIN HITS OPPOSITION SPIRIT IN PARLIAMENT-"THE RESULTS HAVE REALLY GONE BAD. IT WILL TAKE SOME TIME FOR US TO GET OVER IT, ANALYSE AND PLAN THE FUTURE COURSE. BJP VICTORIES HAVE MADE IT IMPERATIVE FOR US TO WORK TOWARDS LARGER UNITY.'),
(35, '2017-02-01', 'pnews', '', '', 'BJP’S NON-RSS CADRE BET PAYS OFF IN 2017 POLLS-FROM A CADRE-BASED PARTY THAT LARGELY FIELDED RSS MEMBERS IN ELECTIONS, BJP HAS METAMORPHOSED INTO A "SECULAR" PARTY WITH SEVEN OF ITS LEGISLATORS BEING CATHOLIC AND FOUR NON-RSS OUT OF 13 NEWLY-ELECTED MLA.'),
(36, '2015-03-24', 'tnews', 'tplace', 'INDIA', 'BOE TECHNOLOGY ENTERS INDIA, TO LAUNCH NEW DEVICES-"WE ARE ALSO ESTABLISHING A PEOPLE-ORIENTED HEALTHCARE SERVICE AND BIG DATA SYSTEM, MAKING HEALTHCARE SERVICES SMARTER AND EFFICIENT," ADDED CHAO.'),
(37, '2017-03-23', 'tnews', '', '', 'BOSE SOUNDSPORT WIRELESS REVIEW: DELIVERS GREAT SOUND SANS PESKY WIRES-THE BATTERY LIFE OF SOUNDSPORT WIRELESS HEADPHONES IS DECENT TOO. IT WAS WORTH OVER FIVE AND A HALF HOURS OF MUSIC PLAYBACK ON A SINGLE CHARGE.'),
(38, '2017-01-20', 'pnews', 'pplace', 'RAJASTHAN', 'CM PUSHES TO MAKE RAJASTHAN A ''''SMART STATE''''-"RAJASTHAN IS PROVIDING 290 IT INTEGRATED SERVICES THROUGH ONE PROGRAMME. THE SERVICES ARE BEING PROVIDED THROUGH 40,000 E-MITRA KIOSKS," SHE SAID.'),
(39, '2017-02-15', 'pnews', '', '', 'SUPREME COURTS''''S ADVICE ON RAM TEMPLE IS ''''SUPERB'''': MAHESH SHARMA-YOGIJI AS CHIEF MINISTER, THE DEVELOPMENT WORKS RELATED TO STATE WOULD GET PACE. HE IS AN ABLE ADMINISTRATOR AND WOULD TAKE THE STATE ON THE PATH OF DEVELOPMENT.'),
(40, '2015-09-14', 'tnews', '', '', 'TCS'''' UK CLIENT SIGNS UP MORE THAN 100K EMPLOYERS TO PENSION SCHEME-"IT IS VITAL THAT OUR IT INFRASTRUCTURE AND DIGITAL SERVICES ARE ABLE TO FLEX AND SCALE TO MEET DEMAND AS AUTO ENROLLMENT CONTINUES TO ROLL-OUT.'),
(41, '2014-01-16', 'cnews', '', '', 'THE 10-YEAR-OLD GIRL, WHOSE BODY WAS FOUND IN A CISTERN WITH A PLASTIC ROPE TIED AROUND HER NECK, MAY HAVE BEEN SEXUALLY ASSAULTED BEFORE BEING GAGGED TO DEATH, ACCORDING TO THE AUTOPSY REPORT.'),
(42, '2011-02-12', 'cnews', '', '', 'THE 22 YR OLD ACCUSED MAHESH PAL ON SATURDAY NIGHT WAS ARRESTED AFTER BEING TRACKED BY THE MISSED CALL HE MADE ONE THE PHONE NUMBER OF THE GIRL''''S FATHER.'),
(43, '2010-12-06', 'cnews', 'cplace', 'KAROL BAGH', 'THE ACCUSED MIRIAM, USED TO CONTACT ARMY OFFICERS AND BUREAUCRATS TO EMPLOY GIRLS SHE TRAFFICKED TO DELHI AND CHARGED HEFTY AMOUNT FOR IT. THEY HAD TIED UP WITH PLACEMENT AGENCIES AND THE GIRLS WOULD BE EMPLOYED AT THE HOUSES IN KAROL BAGH'),
(44, '2015-04-23', 'cnews', '', '', 'THE ACCUSED RAMBALAK HASDA ALLEGEDLY SOLD THREE TRIBAL MINORS OF RS 20000 OVER 1.5 YEARS. PARENTS OF VICTIMS GOT TO KNOW ABOUT THE INVOLVEMENT OF HASDA AND INVITED HIM AND THEN HELD AS A HOSTRAGE BY THE VILLAGERS. FIR WAS LODGED BY THE FATHER.'),
(45, '2015-09-18', 'cnews', '', '', 'THE BOY CLASS 4 STUDENT WAS FOUND UNCONSCIOUS IN HIS ROOM BY HIS FATHER WHO THEN RUSHED HIM TO A HOSPITAL. HE WAS GIVEN TREATMENT AND WAS DECLARED OUT OF DANGER.'),
(46, '2014-01-14', 'cnews', '', '', 'THE BOY WAS AN ORPHAN AND WAS ADOPTED BY ONE OF THE GODMEN SIX MONTHS AGO WHEN HE WAS BROUGHT TO THE ASHRAM BY THE MEMBER. POLICE SAID THAT FOUR COUNSELLORS SPOKE TO THE BOY ABOUT THE SEXUAL ASSAULT.'),
(47, '2012-03-14', 'cnewws', 'cplace', 'NORTH AND SOUTH 24 PARGANAS', 'THE CID ON SATURDAY FILED THE CHARGESHEET AND NAMED 19 OF THE 20 PERSONS ARRESTED IN CONNECTION WITH BABY TRAFFICKING CASES THAT UNFOLDED ACROSS THE CITY, NORTH AND SOUTH 24 PARGANAS 75 DAYS AGO.'),
(48, '2013-01-20', 'cnews', 'cplace', 'MADHYA PRADESH', 'THE GIRL CHILD WAS ALLEGEDLY ABDUCTED FROM A SLUM NEAR C-BLOCK IN SUSHANT LOK.THE ACCUSED BHAJJU RAM AND NEERAJ WAS FROM TEEKAMGARH IN MADHYA PRADESH. THE FAMILY LODGED A COMPLAINT UNDER SECTION 363(ABDUCTION) AND 366A OF THE IPC.'),
(49, '2016-08-16', 'cnews', 'cplace', 'BHUBANESWAR', 'THE GIRLS HAD GONE TO BHUBANESWAR SIX MONTHS BACK WITH A MIDDLEMAN. POLICE SOURCES SAID THEY WERE TAKEN TO NEW DELHI INSTEAD OF BHUBANESWAR. THEY WERE TAKEN BY AGENT RANJAN SANNAGI OF SOMGIRI VILLAGE UNDER HARICHANDANPUR BLOCK TO BHUBANESWAR TO WORK.'),
(50, '2012-02-21', 'cnews', 'cplace', 'JALPAIGURI', 'THE ORPHANAGE IN THE CITY OF JALPAIGURI IN WEST BENGAL, RUN BY A NON PROFIT ORGANISATION, SOLD AT LEAST TWO DOZEN CHILDREN FOR ADOPTION, POLICE SAID.POLICE SAID THE WEST BENGAL ORPHANAGE WAS USING FORGED DOCUMENTS, FAKE STAMPS AND CERTIFICATES.'),
(51, '2010-08-27', 'cnews', '', '', 'THE POCSO E-BOX IS A DIRECT MEDIUM FOR REPORTING CASES OF SEXUAL ASSAULT UNDER PROTECTION OF CHILDREN AGAINST SEXUAL OFFENCES ACT, 2012. STUDENTS CAN LOG ON TO THE WEBSITE AND SELECT FROM SIX PICTURES TO DESCRIBE THE NATURE OF THE COMPLAINT.'),
(52, '2013-10-09', 'cnews', 'cplace', 'MOTIHARI', 'THE RACKET UNFOLDED ON WEDNESDAY AFTER SIX CHILDREN WERE FOUND TRYING TO FLEE FROM DELHI AT ANAND VIHAR RAILWAY STATION.\\R\\NTHE CHILDREN BETWEEN AGES 10 AND 12 DISCLOSED THAT THEY WERE KIDNAPPED FROM MOTIHARI SIX MONTHS BACK AND THEN THEY ARE WORKING.'),
(53, '2015-09-16', 'cnews', 'cplace', 'NEPAL', 'THE SASHASTRA SEEMA BAL (SSB) PERSONNEL, SSB IG CHANCHAL SHEKHAR,  SSB WORKS WITH SEVERAL NON-GOVERNMENT ORGANIZATIONS (NGOS), INCLUDING NEPALESE NGO MAITI NEPAL, TO PREVENT CHILD TRAFFICKING.'),
(54, '2015-01-28', 'cnews', '', '', 'THE SPECIAL TEAM OF COPS HAVE CONDUCTED SURPRISE CHECKS ON CERTAIN AREAS AND RESCUED 45 CHILD LABOURERS WORKING IN MEAT SHOPS, TIFFIN CENTERS, MECHANIS SHEDS, VARIOUS SMALL SCALE UNITS.'),
(55, '2015-01-07', 'cnews', 'cplace', 'INDORE IN MADHYA PRADESH', 'THE TILAK NAGAR POLICE, WHO HAD BROUGHT HIM FROM INDORE IN MADHYA PRADESH, SAID DURING INITIAL INTERROGATIONS, HE ADMITTED THAT IT WAS HIM IN THE CCTV FOOTAGE AND SAID HE HAD PICKED UP THE UNATTENDED RED SUITCASE HOPING TO FIND SOME VALUABLES.'),
(56, '2016-12-02', 'cnews', '', '', 'THE WARDEN, AJAY SHARMA, WAS ACCUSED OF SEXUALLY ABUSING CHILDREN LIVING THERE. HE WAS ALSO CHARGED WITH TOUCHING THEM INAPPROPRIATELY AND CLICKING THEIR OBSCENE PICTURES. SECTION 9/10 AND SECTION 11/12 OF POCSO ACT (SEXUAL ASSAULT AND HARASSMENT).'),
(57, '2013-04-14', 'cnews', 'cplace', 'MUKHERJEE NAGAR, W.B.', 'THE WOMAN WAS TRAFFICKED FROM W.B. ON THE PROMISE OF A JOB BY THE ACCUSED GANESH BURMAN. SHE WORKED AS A MAID IN MUKHERJEE NAGAR.  SHE WAS ADMITTED TO RML HOSPITAL AFTER THE ASSAULT REPEATEDLY OVER A WEEK. THE ACCUSED WAS ARRESTED ON SUNDAY.'),
(58, '2016-02-13', 'tnews', '', '', 'TITAN TO USE IBM''''S CLOUD SOLUTIONS TO BOOST CONSUMER BASE-"THE CONTINUED GROWTH OF E-COMMERCE PRESENTS A TREMENDOUS OPPORTUNITY FOR TITAN TO BETTER MEET THE UNIQUE NEEDS OF OUR CUSTOMERS WHILE TAPPING INTO VITAL NEW REVENUES FOR OUR BUSINESS.'),
(59, '2016-11-12', 'pnews', '', '', 'TN MINISTER, STALIN SPAR OVER TAKING BUDGET TO JAYA MEMORIAL-A VERBAL DUEL ENSUED WHEN JAYAKUMAR SAID DMK HAD NOT TAKEN EFFORTS TO GET TAMIL NADU ITS DUE SHARE OF TAX REVENUE FROM THE UNION GOVERNMENT WHEN THE PARTY HAD BEEN PART OF SEVERAL REGIMES .'),
(60, '2016-11-13', 'tnews', '', '', 'TOYOTA I-ROAD CONCEPT CAR PROMISES QUICK AND CLEAN CITY COMMUTE-TOYOTA IS NO DIFFERENT AND THE MAKERS OF THE PRIUS SEEM TO BE PUSHING FORWARD ITS THREE-WHEELED ELECTRIC CONCEPT - THE I-ROAD.'),
(61, '2016-05-17', 'tnews', 'tplace', 'CHICAGO', 'US-BASED MEDIA OUTLET TRIBUNE OUTSOURCES IT OPERATIONS TO TCS: REPORT-CHICAGO-BASED TRIBUNE PUBLISHING COMPANY SAID IT HAS INFORMED ITS IT EMPLOYEES LAST MONTH THAT IT IS MOVING WORK TO INDIA-BASED IT COMPANY TATA CONSULTANCY SERVICES.'),
(62, '2016-07-18', 'tnews', '', '', 'WHATSAPP TEXT STATUS UPDATE IS BACK: ALL YOU NEED TO KNOW-THE ’STATUS’ UPDATE IN FEBRUARY LET GO OFF THAT SECTION AND THE USERS HAD TO SEARCH FOR A CONTACT IN THE SEARCH BAR TO INITIATE A CONVERSATION.THE FEATURE HAS ONLY ROLLED OUT FOR ANDROID USERS.'),
(63, '2016-05-25', 'tnews', '', '', 'WIPRO OPEN SOURCES ITS BIG DATA SOLUTION-THE PRODUCT ADDRESSES THE COMPLETE LIFECYCLE OF MANAGING DATA ACROSS ENTERPRISE DATA LAKES, MAKING IT POSSIBLE TO INGEST, ORGANIZE, ENRICH, PROCESS, ANALYZE AND GOVERN.'),
